import "bootstrap/dist/css/bootstrap.css";
import React, { useState } from "react";
import "../ExamMaster/Createexam.css";
function Createexam() {
  //  const defaultValue = []
  //   const [users, setUsers] = useState(defaultValue);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = new FormData(e.target);
    const examId = data.get("exam_Id");
    console.log("examId-----", examId);
    const exam_Name = data.get("exam_Name");
    const description = data.get("description");
    const creation_Date = data.get("creation_Date");
    const expiration_Date = data.get("expiration_Date");
    const No_Of_Questions = data.get("No_Of_Questions");
    const duration_Minutes = data.get("duration_Minutes");
    const pass_Percentage = data.get("pass_Percentage");
    const questions_Randomized = data.get("questions_Randomized");
    const answers_Must = data.get("answers_Must");
    const enable_Negativemark = data.get("enable_Negativemark");
    const negative_Markvalue = data.get("negative_Markvalue");

    const map = {
      examId: examId,
      exam_Name: exam_Name,
      description: description,
      creation_Date: creation_Date,
      expiration_Date: expiration_Date,
      No_Of_Questions: No_Of_Questions,
      duration_Minutes: duration_Minutes,
      pass_Percentage: pass_Percentage,
      questions_Randomized: questions_Randomized,
      answers_Must: answers_Must,
      enable_Negativemark: enable_Negativemark,
      negative_Markvalue: negative_Markvalue,
    };
    fetch('https://localhost:8443/onlineexam/control/ExamMasterEvent',{
      method: "POST",
      body: JSON.stringify(map)
    }).then((response)=>console.log(response.text()))
    .catch(err=>console.log('ERROR FROM FETCH',err))
    // try {
    //   const response = await fetch(
    //     "https://localhost:8443/onlineexam/control/ExamMasterEvents",
    //     {
    //       method: "POST",
    //       body: JSON.stringify(map),
    //       //mode: "no-cors",
    //     }
    //   ).then((response)=>response.json())

    // fetch(
    //   "https://localhost:8443/onlineexam/control/ExamMasterEvents",
    //   {
    //            method: "POST",
    //            body: JSON.stringify(map),
    //            mode: "no-cors",
    //          }
    // ).then((response) => response.json());

    // // update the state
    // setUsers(response);

    //   if (!response.ok) {
    //     throw new Error("Network response was not ok");
    //   }

    //   console.log("Form submitted successfully");
    // } catch (error) {
    //   console.error("Error submitting form:", error.message);
    // }
  };

  return (
    <>
      <div className="row mx-3">
        <div className="col-3 "></div>
        <div className="col-6 login">
          <form action="" onSubmit={handleSubmit}>
            <div className="form-group div2">
              <label for="" className="label1">
                ExamId
              </label>
              <input
                type="number"
                id=""
                className="form-control finput"
                placeholder="ExamId eg(1)"
                name="exam_Id"
              />
            </div>
            <div className="form-group div2">
              <label for="" className="label1">
                Examname
              </label>
              <input
                type="text"
                id=""
                className="form-control finput"
                placeholder="Examname"
                name="exam_Name"
              />
            </div>
            <div className="form-group div2">
              <label for="" className="label1">
                Description
              </label>
              <input
                type="text"
                id=""
                className="form-control finput"
                placeholder="Description"
                name="description"
              />
            </div>

            <div className="form-group div2">
              <label for="" className="label1">
                Creationdate
              </label>
              <input
                type="date"
                id=""
                className="form-control finput"
                name="creation_Date"
              />
            </div>

            <div className="form-group div2">
              <label for="" className="label1">
                Expirationdate
              </label>
              <input
                type="date"
                id=""
                className="form-control finput"
                name="expiration_Date"
              />
            </div>
            <div className="form-group div2">
              <label for="" className="label1">
                NoOfQuestions
              </label>
              <input
                type="text"
                id=""
                className="form-control finput"
                placeholder="No of questions"
                name="No_Of_Questions"
              />
            </div>

            <div className="form-group div2">
              <label for="" className="label1">
                Durationminutes
              </label>
              <input
                type="text"
                id=""
                placeholder="Duration Minutes eg(60-Minutes)"
                name="duration_Minutes"
                className="form-control finput"
              />
            </div>
            <div className="form-group div2">
              <label for="" className="label1">
                Passpercentage
              </label>
              <input
                type="text"
                id=""
                placeholder="pass-percentage eg(25%)"
                name="pass_Percentage"
                className="form-control finput"
              />
            </div>
            <div className="form-group div2">
              <label for="" className="label1">
                QuestionsRandomized
              </label>
              <input
                type="text"
                name="questions_Randomized"
                className="form-control finput"
                id=""
                placeholder="questions randomized eg(Yes or No)"
              />
            </div>
            <div className="form-group div2">
              <label for="" className="label1">
                Answersmust
              </label>
              <input
                type="text"
                name="answers_Must"
                placeholder="To Answer is must eg(Y OR N)"
                id=""
                className="form-control finput"
              />
              {/* <select name="" type="dropdown" id=""></select> */}
            </div>
            <div className="form-group div2">
              <label for="" className="label1">
                Enablenegativemark
              </label>
              <input
                type="text"
                name="enable_Negativemark"
                placeholder="Enablenegativemark eg(Y OR N)"
                id=""
                className="form-control finput"
              />
            </div>
            <div className="form-group div2">
              <label for="" className="label1">
                NegativeMarkvalue
              </label>
              <input
                type="text"
                placeholder="Negativemarkvalue eg(0.25)"
                id=""
                name="negative_Markvalue"
                className="form-control finput"
              />
            </div>

            <button type="submit" className="btn btn-primary mt-4">
              Submit
            </button>
          </form>
        </div>

        <div className="col-3"></div>
      </div>
    </>
  );
}

export default Createexam;
